import math

def check_prime(no):
    if no == 0 and no == 1:
        return False
    start = 2
    end = int(math.sqrt(no))
    while start <= end:
        if no % start == 0:
            return False
        start += 1
    return True

def count_prime_numbers(test_cases):
    results = []
    for case in test_cases:
        prime_count = sum((1 for num in case if check_prime(num)))
        results.append(prime_count)
    return results

